import React, { useState } from "react";
import { Mail, Lock, Loader2, UserPlus } from "lucide-react";
import { useNavigate } from "react-router-dom";
import StarBackground from "../StarsBackground/StarsBackground";
import "./Register.css";

interface RegisterProps {
  setAuth: (authState: boolean) => void; // Prop to update auth state in parent component
}

const Register: React.FC<RegisterProps> = ({ setAuth }) => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [confirmPassword, setConfirmPassword] = useState("");
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState("");
  const navigate = useNavigate();

  // Handle form submission for registration
  const handleRegister = async (e: React.FormEvent) => {
    e.preventDefault();

    if (!email || !password || !confirmPassword) {
      setError("Please fill in all fields!");
      return;
    }

    if (password !== confirmPassword) {
      setError("Passwords do not match!");
      return;
    }

    setIsLoading(true);
    setError("");

    try {
      const response = await fetch("http://localhost:5000/api/users/register", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        credentials: "include",
        body: JSON.stringify({ email, password }),
      });

      const data = await response.json();

      if (response.ok) {
        setAuth(true); // Update authentication state
        navigate("/"); // Redirect to homepage
      } else {
        setError(data.error || "Registration failed.");
      }
    } catch (error) {
      setError("Something went wrong during registration.");
      console.error("Registration error:", error);
    } finally {
      setIsLoading(false); // Stop loading spinner
    }
  };

  return (
    <div className={`register-page ${isLoading ? "processing" : ""}`}>
      <StarBackground />
      <div className="register-content">
        {/* Logo Section */}
        <div className="logo-container">
          <h1 className="app-logo">
            Stud<span className="help-text">Help</span>
          </h1>
        </div>

        {/* Registration Form */}
        <form className="register-box" onSubmit={handleRegister}>
          <h2 className="register-title">Create an Account</h2>
          <p className="register-subtitle">Start exploring study resources</p>

          {/* Error Message */}
          {error && <div className="error-message">{error}</div>}

          {/* Email Input */}
          <div className="input-group">
            <Mail className="input-icon" />
            <input
              type="email"
              placeholder="Enter your email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              disabled={isLoading}
            />
          </div>

          {/* Password Input */}
          <div className="input-group">
            <Lock className="input-icon" />
            <input
              type="password"
              placeholder="Enter your password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              disabled={isLoading}
            />
          </div>

          {/* Confirm Password Input */}
          <div className="input-group">
            <Lock className="input-icon" />
            <input
              type="password"
              placeholder="Confirm your password"
              value={confirmPassword}
              onChange={(e) => setConfirmPassword(e.target.value)}
              disabled={isLoading}
            />
          </div>

          {/* Submit Button */}
          <button type="submit" className="register-btn" disabled={isLoading}>
            {isLoading ? (
              <Loader2 className="btn-icon spin" />
            ) : (
              <>
                <UserPlus className="btn-icon" /> Sign Up
              </>
            )}
          </button>

          {/* Redirect to Login */}
          <p className="login-text">
            Already have an account?{" "}
            <span className="login-link" onClick={() => navigate("/login")}>
              Log in
            </span>
          </p>
        </form>
      </div>
    </div>
  );
};

export default Register;
